import React from "react"
import Home from "./Home.js"
import ChooseMenu from "./ChooseMenu.js"
import 'bootstrap/dist/css/bootstrap.min.css';
import "./style.css"
import { Collapse ,Container, Row,Col,Nav,Tab,Tabs} from "react-bootstrap";
import {BrowserRouter as Router,Route,} from "react-router-dom"


class App extends React.Component {
  constructor(props){
    super(props)
    this.state={
      homemenustart:false,
      homemenu:false,
      wait:""
    }
  }
  sethomemenu(event){
    this.setState({wait:500})
    this.setState({homemenu:event}) 
    this.space(event);
  }
  space(event){
    if(event){
      setTimeout(function() {
        this.setState({homemenustart:event})
      }.bind(this), 200);  
    }    
  }
  render() {
    return (
      <div className="text-center bg-dark">
        <div className="APPbackground">
          <Container className="mb-auto">
            <Row>
              <Col className="md-2 mb-3 mb-md-auto h3 ">Numer</Col>
              <Col >
                <Container>
                  <li>
                    <a href="/">HOME</a> <a href="/ChooseMenu">Method</a> <a href="/">HOME</a>
                  </li>
                </Container>
              </Col>
            </Row>
          </Container>
        </div>
        <Router>
          <Route path="/" component={Home} exact/>
          <Route path="/ChooseMenu" component={ChooseMenu} />
        </Router>
        <footer className="footer center">
          <div>Made By <a href="https://www.facebook.com/title.tawan" target="_self">Title Tawan.</a></div >
        </footer>
      </div>
    )
  }
}

export default App;
